            props.userdata.map((user, index) => {
                { /* console.log(user.address); */ }
                return ( <
                    Fragment key = { index } >
                    <
                    tr className = "tr" >
                    <
                    td className = "td" > { user.id } < /td> <
                    td className = "td" > { user.name } < /td> <
                    td className = "td" > { user.email } < /td> <
                    td className = "td" > { user.phone } < /td> <
                    td className = "td" > { user.address.street }, { user.address.suite }, { user.address.city }, { user.address.zipcode } <
                    /td> <
                    td > < button onClick = {
                        (e) => showPost(user.id) } > Views < /button>  <
                    /td> <
                    /tr> <
                    /Fragment>
                );
            })
        } <
        /table> <
        />
    );
};

export default UserDatas;
